import React, { useEffect, useState } from 'react';
import HeroSection from '../../components/landingpage/HeroSection.js';
import AboutUs from './../../components/landingpage/AboutUs';
import Services from './../../components/landingpage/Services';
import Portfolio from './../../components/landingpage/Portfolio';
import Testimonials from './../../components/landingpage/Testimonials';
import ContactUs from './../../components/landingpage/ContactUs';
import FAQ from './../../components/landingpage/FAQ';

const LandingPage = () => {
  const [headerColor, setHeaderColor] = useState('#00183d');
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const handleScroll = () => {
    const scrollTop = window.scrollY;
    if (scrollTop > 50) {
      setHeaderColor('#002d55');
    } else {
      setHeaderColor('#00183d');
    }
  };

  useEffect(() => {
    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  const scrollToSection = (id) => {
    const element = document.getElementById(id);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
      setIsMobileMenuOpen(false);
    }
  };

  // Custom hamburger menu icon component
  const HamburgerIcon = ({ isOpen }) => (
    <div className="flex flex-col justify-center items-center w-6 h-6 space-y-1.5">
      <span 
        className={`block w-6 h-0.5 bg-white transition-transform duration-300 ${
          isOpen ? 'transform rotate-45 translate-y-2' : ''
        }`}
      />
      <span 
        className={`block w-6 h-0.5 bg-white transition-opacity duration-300 ${
          isOpen ? 'opacity-0' : ''
        }`}
      />
      <span 
        className={`block w-6 h-0.5 bg-white transition-transform duration-300 ${
          isOpen ? 'transform -rotate-45 -translate-y-2' : ''
        }`}
      />
    </div>
  );

  const NavLink = ({ href, children }) => (
    <a 
      href={href}
      onClick={(e) => { e.preventDefault(); scrollToSection(href.slice(1)); }}
      className="text-white no-underline font-bold text-lg md:text-base hover:text-yellow-400 transition-colors duration-300"
    >
      {children}
    </a>
  );

  return (
    <div>
      <header className="fixed top-0 left-0 right-0 z-50 transition-colors duration-300"
        style={{ backgroundColor: headerColor }}>
        <div className="px-4 md:px-6 h-16 md:h-20 flex items-center justify-between">
          <img 
            src={require('./../../assets/logo.png')} 
            alt="Logo" 
            className="h-8 md:h-12"
          />

          {/* Desktop Navigation */}
          <nav className="hidden md:block">
            <ul className="flex space-x-6">
              <li><NavLink href="#about-us">About Us</NavLink></li>
              <li><NavLink href="#services">Services</NavLink></li>
              <li><NavLink href="#portfolio">Portfolio</NavLink></li>
            </ul>
          </nav>

          {/* Mobile Menu Button */}
          <button 
            className="md:hidden p-2"
            onClick={() => setIsMobileMenuOpen(!isMobileMenuOpen)}
            aria-label="Toggle menu"
          >
            <HamburgerIcon isOpen={isMobileMenuOpen} />
          </button>
        </div>

        {/* Mobile Navigation */}
        <nav 
          className={`md:hidden bg-opacity-95 transition-all duration-300 ${
            isMobileMenuOpen ? 'max-h-48 opacity-100' : 'max-h-0 opacity-0 overflow-hidden'
          }`}
          style={{ backgroundColor: headerColor }}
        >
          <ul className="px-4 py-2 space-y-4">
            <li className="border-b border-gray-700 pb-2">
              <NavLink href="#about-us">About Us</NavLink>
            </li>
            <li className="border-b border-gray-700 pb-2">
              <NavLink href="#services">Services</NavLink>
            </li>
            <li className="pb-2">
              <NavLink href="#portfolio">Portfolio</NavLink>
            </li>
          </ul>
        </nav>
      </header>

      <div className="pt-16 md:pt-20">
        <HeroSection />
        <div id="about-us"><AboutUs /></div>
        <div id="services"><Services /></div>
        <div id="portfolio"><Portfolio /></div>
        <Testimonials />
        <ContactUs />
        <FAQ />
      </div>
    </div>
  );
};

export default LandingPage;
